import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'ic-error-403',
  templateUrl: './ic-403.component.html',
  styles: [
    `
      .red {
        color: #d9534f;
      }
    `,
  ],
})
export class Connect403Component implements OnInit {
  location: any;

  constructor(private router: Router) {}

  ngOnInit(): void {
    this.location = document.domain;
  }

  public goHome(): any {
    this.router.navigate(['']);
  }
}
<div class="text-center">
  <div>
    <div class="col-md-12">
      <span class="hipster img-fluid img-rounded"></span>
    </div>
    <div class="col-md-12">
      <h1><fa-icon icon="ban"></fa-icon> <span icTranslate="error.403"></span></h1>
      <p class="lead">
        <span icTranslate="error.403PageContent"></span
        ><em
          ><span>{{ location }}</span></em
        >.
      </p>
      <p><button type="button" class="btn btn-secondary" (click)="goHome()" icTranslate="error.goHomeBtnText"></button></p>
    </div>
  </div>
</div>
